using namespace std;

class Solution {
public:
    long long countSubstrings(string s, char c) {
        long long cnt = count(s.begin(), s.end(), c);
        return cnt * (cnt + 1) / 2;
    }
};

int main() {
    // cout<<"Hello World!";
    string s = "abba";
    char c = 'a';
    Solution obj;
    cout<<obj.countSubstrings(s,c)<<"\n";
    return 0;
}

